description:
The Complex Rock Tour Live is a live DVD by Blue Man Group in support of their album, The Complex with footage from their shows in Dallas, Texas. It features almost all of the songs from that album, one song (&quot;Drumbone&quot;) from their older album, Audio, and a cover of The Who song &quot;Baba O&amp;#039;Riley&quot;. The DVD also has three music videos on it: &quot;Sing Along&quot;, &quot;The Current&quot;, and &quot;Exhibit 13&quot;.

